int nextPattern(int cPattern) {
  if(cPattern<( (sizeof(patternStarts)/sizeof(patternStarts[0]))-1) )
  {
    return (cPattern++);
  }
  else { //back to beginning
    return 0;
  }
}

float getSWVoltage() {
  //return ( ((float)getSWRaw()/(float)4095) * 2.600*2.0 );
  return (float)(digitalRead(POWERSW)); //swap to using digitalRead now that we can
}

int getBatRaw() {
  int bat = adc1_get_raw(ADC1_CHANNEL_3);
  return bat; 
}

float getBatVoltage() {
  int bat = getBatRaw();
  return ( ((float)bat/(float)4095) * 2.600*2.0 );
}

int getBatPercent10 (float voltage) {
  
  voltage+=0;//add a trim if needed
  
  if (voltage<3.0) { return 1; }
  else if (voltage < 3.1 ){ return 2; }
  else if (voltage < 3.3 ){ return 3; }
  else if (voltage < 3.45) { return 4; }
  else if (voltage < 3.5 ) { return 5; }
  else if (voltage < 3.53) { return 6; }
  else if (voltage < 3.57) { return 7; }
  else if (voltage < 3.61) { return 8; }
  else if (voltage < 3.69) { return 9; }
  else if (voltage < 3.8 ) { return 10; }
}

void setup() { 
  currentMode=-1;
	//Serial.begin(57600);
	//Serial.println("resetting");
	FastLED.addLeds<APA102,DATA_PIN,CLOCK_PIN,BGR>(leds,NUM_LEDS);
	FastLED.setBrightness(3);

  pinMode(KEEPALIVE,OUTPUT);
  digitalWrite(KEEPALIVE,HIGH);
  Serial.begin(115200);

  adc1_config_width(ADC_WIDTH_BIT_12);
  adc1_config_channel_atten(ADC1_CHANNEL_3,ADC_ATTEN_DB_11); //set channel atenuation to 11db (optional)

  //adc2_config_width(ADC_WIDTH_BIT_12);

  //adc2_config_channel_atten(ADC2_CHANNEL_0,ADC_ATTEN_DB_11); //attenuation to 11db, enough to read 0-2600mV
  
  //ledcSetup(0, 1000, 8); //channel1, 1000Hz frequency, 8 bit resolution
  //ledcAttachPin(PWMPin, 1); //map any ADC suported pin to "channel 1"
  int bat = adc1_get_raw(ADC1_CHANNEL_3);
  int sw = getSWVoltage();
  //adc2_get_raw(ADC2_CHANNEL_0);
  
  Serial.println("#################   CRYSTAL V7   #################");
  Serial.println("#  Larry Kresse, 2023                            #");
  Serial.println("#  glowstick - noled PCB HW2                     #");
  Serial.println("##################################################");
  Serial.println("");
  //print battery voltage
  Serial.print("Battery Voltage:");
  Serial.print( ((float)bat/(float)4095) * 2.600*2.0 );
  Serial.println(" V");

  Serial.print("Switch Voltage:");
  //Serial.print(((float)sw/(float)4095) * 2.600*2.0);
  Serial.print(getSWVoltage());
  Serial.println(" V");

  FastLED.setBrightness(4);

  
  pinMode(KEEPALIVE,OUTPUT);
  
  while(digitalRead(POWERSW)==1) { //make sure user releases power sw to boot
    leds[0]=CRGB(255,0,0);
    FastLED.show();
    delay(300);
    leds[0]=CRGB(0,255,0);
    FastLED.show();
    delay(300);  
    leds[0]=CRGB(0,0,255);
    FastLED.show();
    delay(300);    
    digitalWrite(KEEPALIVE,HIGH);
  }

  delay(200);
  
  buttonPressTime=millis();
  patternSwitchTime=millis();
}

void fadeall() { for(int i = 0; i < NUM_LEDS; i++) { leds[i].nscale8(250); } }


bool buttonPressed=false;

int buttonCounter=0;

int blinkCounter=0;


int chargeTimer=0;

void loop() { 
  if(digitalRead(CHG)==0 && DEBUG_LEDS==false){ //charging
    currentMode=-1;
  } else if (digitalRead(CHG)==1 && currentMode==-1) {
    currentMode=100;
  }
  
  if(getSWVoltage()>0.75)                     //digitalRead(POWERSW)==1) //button is being held
  {
    //Serial.print("POwersw:");
    //Serial.println(analogRead(POWERSW));
    buttonPressed=true;
    buttonCounter++;
    //button was pressed, don't increment button time

   } else {
    buttonPressed=false;
    buttonPressTime=millis();
    if(buttonCounter>0) {
      buttonCounter-=10;
    }
   }
   
   //buttonPressed=false;
   if (buttonPressTime < millis()-2000) { //button was pressed >2000ms ago
    Serial.println("Shutdown");
    digitalWrite(KEEPALIVE,LOW);//turn off sys
    delay(1000);
    buttonPressTime=millis(); //never runs I think
   }
   if (buttonCounter > 200 ) {
    //switch modes
    Serial.println(nextMode(currentMode));
    
    //buttonCounter=0;
    currentMode=nextMode(currentMode);
    buttonCounter=0;
    
    float sw = getSWVoltage();
    Serial.print(sw);
    
    delay(1000);
    //buttonCounter+=200;
    //buttonPressTime=millis(); //never runs I think
   }


  //mode switch
  if(currentMode==-1){ //charge mode


    if(chargeTimer==80000)
    {
      float voltage = getBatVoltage();
      int per = getBatPercent10(voltage);
  
      for(int i=0;i<10;i++) {
        leds[i]=CRGB(255,0,0); //red
      }
      
      for(int i=0;i<per;i++) {
        leds[i]=CRGB(0,255,0);//green
      }
      for(int i=10;i<NUM_LEDS;i++)
      {
        leds[i]=CRGB(0,0,0);
      }
      FastLED.show();
    }

    if(chargeTimer>=100000) {
      chargeTimer=0;
      leds[0]=CRGB(255,255,255);
      for(int i=1;i<NUM_LEDS;i++)
      {
        leds[i]=CRGB(0,0,0);
      }
      FastLED.show();
    }
    chargeTimer++;
//    if (blinkCounter>100) {
//      blinkCounter=0;
//      lit=!lit;
//    }
//    else {
//      blinkCounter++;
//    }
//    if(lit==true) {
//      leds[0]=CRGB(0,0,0);
//      leds[1]=CRGB(0,255,0);
//    } else {
      //leds[0]=CRGB(255,0,0);
      //leds[1]=CRGB(0,255,0);      
   // }
    

  } else {
    if(currentMode==100) {//pattern switch mode
      if(patternSwitchTime<(millis()-6000)) { //last pattern switch was more than 6s ago
          currentPattern=nextPattern(currentPattern);
      }
      
    }
    else { //constant pattern mode
      currentPattern = currentMode;//(sizeof(patternStarts)/sizeof(patternStarts[0]))-1)
    }
    if(linetimer>1)
    {
      
      if(cursorPos>patternEnds[currentPattern] || cursorPos<patternStarts[currentPattern])
      {
        cursorPos=patternStarts[currentPattern];
      }
      else
      {
        cursorPos++;
      }
  
      for(int height=0;height<NUM_LEDS;height++)
      {
        leds[height]=get_pixel(cursorPos,height);
      }
      FastLED.show();
      linetimer=0;
    } else {
      linetimer++;
    }
   
  
  

    linetimer++;

  }
  delay(0.1);
}

